      SELECT - col2 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT BETWEEN col2 * col0 + - + col0 AND - col1 + - CAST ( NULL AS INTEGER );
  - name: tab2

